def add_and_assign_nodes(apps, schema_editor):
    cnt=0
    print('Nodes')
    GeoNode = apps.get_model('TalkToTen', 'GeoNode')
    for node_data in nodes_data:
        cnt += 1
        if (cnt % 100 == 0):
            print(cnt)
        GeoNode.objects.create(id=node_data.id, latitude=node_data.lat, longitude=node_data.lng)

    cnt=0
    print('Edges')
    GeoEdge = apps.get_model('TalkToTen', 'GeoEdge')
    for edge_data in edges_data:
        cnt += 1
        if (cnt % 100 == 0):
            print(cnt)

        GeoEdge.objects.create(id=edge_data.id, street=edge_data.street, start_node_id=edge_data.start_node,
                               end_node_id=edge_data.end_node, length=edge_data.dist)

    # fix this
    cnt = 0
    print('Households')
    Household = apps.get_model('TalkToTen', 'Household')
    for household in Household.objects.all():
        cnt += 1
        if (cnt % 100 == 0):
            print(cnt)
        edge = GeoEdge.objects.filter(
            street=household.street
        ).annotate(
            dist=(69. * (household.latitude - (0.5 * (F('start_node__latitude') + F('end_node__latitude'))))) ** 2 +
                 (51. * (household.longitude - (0.5 * (F('start_node__longitude') + F('end_node__longitude'))))) ** 2
        ).order_by('dist').first()
        if edge is None:
            print("CANNOT FIND GEOEDGE FOR HOUSEHOLD",household.address)
        else:
            household.geo_edge = edge
            household.save()

